    "Monitoring of Nesting Spectacled Eiders on Kigigak Island, Yukon Delta NWR, 2011",nt"tracking_summary":
    {ntt"total": 13,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:25:05.910004",nt"name": "monitoring-of-nesting-spectacled-eiders-on-kigigak-island-yukon-delta-nwr-2011",nt"isopen":
    false,nt"url": null,nt"notes": "Nesting spectacled eiders were monitored
    for the 20th consecutive year on Kigigak Island, Alaska in 2011. Clutch size, hatch
    date, and final nest status were determined to estimate nesting productivity of
    spectacled eider females. In addition, adult females were resighted, captured, and
    marked to estimate annual survival. Peak nest initiation and hatch occurred 27-30
    May and 20-23 June, respectively. We located 114 spectacled eider nests on 33 plots.
    Of these 114, 27 were unsuccessful due to natural causes, including depredation
    (25 nests, 21.9%) and addled/inviable eggs (2 nests, 1.8%), and 2 were unsuccessful
    due to human influences (1.8%). The estimated Mayfield nest success of 103 nests
    was 57.9% (95% CI; 45.0-68.7%). Eighty-six adult females were identified in 2011:
    71 were nest-trapped and 15 were visually identified by nasal disk or tarsal band.
    Forty-six of the nest-trapped females were recaptures; the other twenty-five were
    new captures. Three of the 46 recaptured birds had been banded as ducklings in 2008
    and were observed nesting on Kigigak Island for the first time in 2011.",nt"license_title":
